import React, {Component} from "react";
import './App.css';


const App = () => {
  return (
    <div className="app-wrapper">
        <header className='header'>
            <img src='https://upload.wikimedia.org/wikipedia/commons/thumb/f/f4/BMW_logo_%28gray%29.svg/240px-BMW_logo_%28gray%29.svg.png'/>
        </header >
        <nav className='nav'>
            <div>
                profile
            </div>
            <div>
                message
            </div>
        </nav>
        <div className='content'>
            <div>
                <img src='https://thumbor.forbes.com/thumbor/fit-in/1200x0/filters%3Aformat%28jpg%29/https%3A%2F%2Fspecials-images.forbesimg.com%2Fimageserve%2F5d35eacaf1176b0008974b54%2F0x0.jpg%3FcropX1%3D790%26cropX2%3D5350%26cropY1%3D784%26cropY2%3D3349'/>
            </div>
        </div>
    </div>
  );
}

export default App;
